	"conf": {
		"dagId": "test_dag",
		"tasks": [
			{
				"id": "id1",
				"operator_import": "airflow.providers.docker.operators.docker",
				"operator_type": "DockerOperator",
				"operator_params": {
					"image":"trimmomatic:latest",
					"api_version":"auto",
					"mounts": [
						{
						"target":"/fastq",
						"source":"/opt/.fastqTest",
						"type":"bind"	
						}
					],
					"command": "java -jar /NGStools/Trimmomatic-0.39/trimmomatic.jar PE -phred33 /fastq/sample1_1.fastq /fastq/sample1_2.fastq /fastq/sample1_R1_trimmed.fastq /fastq/sample1_R1_untrimmed.fastq /fastq/sample1_R2_trimmed.fastq /fastq/sample1_R2_untrimmed.fastq ILLUMINACLIP:/NGStools/Trimmomatic-0.39/adapters/TruSeq3-SE.fa:2:30:10",
					"auto_remove": true,
					"docker_url": "unix://var/run/docker.sock",
					"network_mode": "bridge"
				}
			},
			{
				"id": "id2",
				"operator_import": "airflow.providers.docker.operators.docker",
				"operator_type": "DockerOperator",
				"operator_params": {
					"image":"spades:latest",
					"api_version":"auto",
					"mounts": [
						{
						"target":"/fastq",
						"source":"/opt/.fastqTest",
						"type":"bind"	
						}
					],
					"command":"/NGStools/SPAdes-3.14.0-Linux/bin/spades.py -k 21,33,55,77 --careful --only-assembler --pe1-1 /fastq/sample1_R1_trimmed.fastq --pe1-2 /fastq/sample1_R2_trimmed.fastq -o /fastq/fq_spades.fasta",
					"auto_remove": true,
					"docker_url": "unix://var/run/docker.sock",
					"network_mode": "bridge"
				}
			},
			{
				"id": "id3",
				"operator_import": "airflow.providers.docker.operators.docker",
				"operator_type": "DockerOperator",
				"operator_params": {
					"task_id":"abricate",
					"image":"abricate:latest",
					"api_version":"auto",
					"mounts": [
						{
						"target":"/fastq",
						"source":"/opt/.fastqTest",
						"type":"bind"	
						}
					],
					"command":"abricate /fastq/fq_spades.fasta/contigs.fasta --db card --csv",
					"auto_remove": true,
					"docker_url": "unix://var/run/docker.sock",
					"network_mode": "bridge"
				}
			}
		],
		"execution_order": "id1 >> id2 >> id3"
	}	
}
